DROP TABLE IF EXISTS pays;
CREATE TABLE IF NOT EXISTS pays(
   id_pays  INTEGER  NOT NULL PRIMARY KEY 
  ,nom_pays VARCHAR(32)
);


DROP TABLE IF EXISTS economie;
CREATE TABLE economie(
   id_pays                  INTEGER  NOT NULL
  ,annee                    INTEGER  NOT NULL
  ,id_continents            INTEGER 
  ,Statuts                  VARCHAR(10)
  ,Pourcentage_de_depense   NUMERIC(13,8)
  ,Depenses_totales         NUMERIC(5,2)
  ,PIB                      NUMERIC(8,2)
  ,Population               INTEGER 
  ,Scolarite                NUMERIC(4,1)
  ,Superficie               INTEGER 
  ,Densite_km2              NUMERIC(8,2)
  ,Taux_croissance          NUMERIC(6,4)
  ,Pourcentage_pop_mondiale NUMERIC(5,2)
  ,PRIMARY KEY(id_pays,annee)
  ,FOREIGN KEY(id_pays) REFERENCES pays(id_pays)
);


DROP TABLE IF EXISTS continents;
CREATE TABLE IF NOT EXISTS continents(
   id_continent  INTEGER  NOT NULL PRIMARY KEY 
  ,nom_continent VARCHAR(13)
);


DROP TABLE IF EXISTS sante;
CREATE TABLE sante (
    id_pays INTEGER,
    annee INTEGER,
    esperance_de_vie DECIMAL(4,1),
    taux_mortalite_adulte INTEGER,
    taux_mortalite_infantile INTEGER,
    alcool DECIMAL(4,2),
    hepatite_b INTEGER,
    rougeole INTEGER,
    imc DECIMAL(4,1),
    deces_chez_les_moins_de_5_ans INTEGER,
    poliomyelite INTEGER,
    diphterie INTEGER,
    vih_sida DECIMAL(3,1),
    malnutrition_5_9_ans DECIMAL(4,1),
    PRIMARY KEY (id_pays, annee),
    FOREIGN KEY (id_pays) REFERENCES pays(id_pays)
);
















